function Info(porps) {
    return(
    <div className="main__cont">
        <div>{porps.text1}</div>
        <div></div>
        <div></div>
        <div></div>
    </div>
    );
}



function Main() {
    return (
      <div id="wrap">
        <Header/>
        <section id="mainCont">
           <Info 
            text1 = "WE PROVIDE"
            text2 = "VISUAL CODING"
            text3 = "SOLUTIONS"
            text4 = "FOR YOU WEBS"
           />
        </section>
        <Footer/>
      </div>
    );
  }

export default Main;
